import React from 'react'
import { Dropdown } from 'semantic-ui-react'
export default function Cities() {
    return (
        <div>
            <Dropdown item text='Language'>
                <Dropdown.Menu>
                    <Dropdown.Item>Elma</Dropdown.Item>
                </Dropdown.Menu>
            </Dropdown>
        </div>
    )
}
